import React from 'react'
import CartItem from './CartItem'

function Cart({ products, cart, handler }) {
    console.log('Create Cart ' + JSON.stringify(cart));
    return (
        Object.keys(cart).forEach(key => {
            console.log('Creating: ' + key + ' - ' + cart[key])
            return <CartItem key={key} product={products.find(prod => prod.id == key)} count={cart[key]} deletionHandler={handler} />
        })
    )
}

export default Cart
